import React, { Component } from "react";

class User extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <Breadcrumb>
                    <BreadcrumbItem ><Link to="/">Enter User</Link></BreadcrumbItem>
                    <BreadcrumbItem active>Users</BreadcrumbItem>
                </Breadcrumb>

                <ul>
                    <li>User1</li>
                    <li>User2</li>

                </ul>
            </div>
        )
    }
}

export default User;
